import React, {useEffect, useState} from 'react';
import axios from 'axios';
import OnTheBoard from "./OnTheBoard";


function App() {
   const [hello, setHello] = useState('')

    useEffect(() => {
        axios.get('/api/hello')
        .then(response => setHello(response.data))
        .catch(error => console.log(error))
    }, []);

    return (
         <div className="App">
              <OnTheBoard/>
            </div>
    );
}

export default App;
